import './Service.css';
import { useEffect } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFileCode, faPen, faSearch } from '@fortawesome/free-solid-svg-icons'; 

import TitleSection from "../../component/TitleSection/TitleSection.jsx";

export default function Blog() {
    //Function to change logo color when hovering
    //We use useEffect to select elements when the DOM is "loaded";
    useEffect(() => {
        function changeColor() {
            let containers1 = document.querySelector(".services-container__opti")
            let containers2 = document.querySelector(".services-container__dev")
            let containers3 = document.querySelector(".services-container__design")

            let containers = [containers1, containers2, containers3];

            containers.forEach(container => {
                let logo = container.querySelector(".logo");
                container.addEventListener("mouseover", () => {
                    logo.style.color = "#dcdcdc";
                } )
                container.addEventListener("mouseout", () => {
                    logo.style.color = "#000000";
                } )
            })

        }
        changeColor()
    },[])

    return(
        <main>
            <TitleSection title="MES SERVICES"/>
            <div className="container main__services-container ">
                <div className="row">
                    <div className="col-12">
                        <div className= "row services-container">
                            {/* Card 1 */}
                            <div className="col-sm-8 col-md-4 col-lg-4 services-card">
                                <div className=" services-container__opti">
                                    <FontAwesomeIcon icon={faSearch} className="logo search-design-logo"/>
                                    <h2>OPTMISATION DE LA PERFORMANCE WEB</h2>
                                    <p>Mes services <strong>d'optimisation de la performance web</strong> 
                                    vise à rendre votre site internet plus rapide et plus efficace. <br/>En brief, 
                                    cela signifie que votre site se <strong>chargera plus rapidement</strong> lorsque les visiteurs viendront le voir.<br/> </p>
                                </div>
                            </div>                                          
                            {/* Card 2 */}
                            <div className="col-sm-8 col-md-4 col-lg-4 services-card">
                                <div className="services-container__dev">
                                    <FontAwesomeIcon icon={faFileCode} className="logo file-code-design-logo"/>
                                    <h2>CONCEPTION DE SITES WEB</h2>
                                    <p>Mes services de <strong>conception de sites web</strong> consiste à créer des sites Internet personnalisés.<br/>
                                    J'utiliserai des outils spéciaux pour rendre votre site <strong>unique et adapté</strong> à vos besoins.<br/></p>
                                </div>
                            </div>
                            {/* Card 3 */}
                            <div className="col-sm-8 col-md-4 col-lg-4 services-card">
                                <div className="services-container__design">
                                    <FontAwesomeIcon icon={faPen} className="logo pen-design-logo"/>
                                    <h2>DESIGN DE SITE WEB</h2>
                                    <p>Mes services de <strong>Design de Site Web</strong> offre des solutions sur mesure pour créer des expériences en ligne <strong>uniques et attrayants.</strong>
                                    <br/>Je concevrai vos sites web esthétiquement plaisants, faciles à naviguer et adaptés à tous les appareils, du <strong>bureau aux smartphones.</strong> <br/> </p>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>

            </div>
        </main>
    )
}
